                <div className="flex justify-center">
                    <span className="material-icons flex flex-row">bar_chart</span> Statistiques{' '}
                </div>
                <div className="flex justify-center">
                    <span class="material-icons flex flex-row px-1 text-green">trending_up</span>250
                    <span class="material-icons px-1 text-[#6b21a8]">loop</span>50
                </div>
            </div>
            <div className="flex flex-row gap-5 w-full">
                {trainings.map((train) => (
                    <BoxFormation key={train.id} name={train.name} />
                ))}
            </div>
        </div>
    )
}

